import React, { useEffect, useRef, useState } from "react";
import Header from '../common/Header.js';
import Head from '../common/Head.js';
import $ from 'jquery';
import { ReactSession } from 'react-client-session';
import { Slide } from 'react-slideshow-image';
import 'react-slideshow-image/dist/styles.css'
import Popup from 'reactjs-popup';
import Loader from "../common/Loader.js";
import 'reactjs-popup/dist/index.css';
import { useNavigate, useLocation, Link } from "react-router-dom";
import { PayPalScriptProvider, PayPalButtons } from "@paypal/react-paypal-js";
import API_BASE_URL, { KETO_IMG_CDN_LIVE } from "../../config/constants.js";
import { final_images } from "../../config/imagedata/images_data5.js";


export default function Final() {


    const slideImages = [
        {
            sliderim: final_images["mobile"],
        },
        {
            sliderim: final_images["mobile2"],
        },
        {
            sliderim: final_images["mobile3"],
        },
    ];


    ReactSession.setStoreType('localStorage');
    let history = useNavigate();
    let result = useLocation();
    let currentURL = window.location.href;
    var url = new URL(currentURL);


    // let trmObj1 = result.target
    //console.log(result)

    // console.log(result);
    // Extract the base URL (protocol, hostname, and port)
    var baseUrl = url.protocol + '//' + url.hostname + (url.port ? ':' + url.port : '');

    const currency_symbols = { usd: "$", gbp: "Â£", cad: "$", aud: "$" }

    /* custom timer */
    const Ref = useRef(null);

    // The state for our timer
    const [timer, setTimer] = useState('00:14:59');
    const [urlPre, setUrlPre] = useState("");
    const [isLoading, setIsLoading] = useState(false);
    const [isPgProcessing, setIsPgProcessing] = useState(false);
    const [Bearer, setBearer] = useState("");



    // time runner start--------------------------------

    const getTimeRemaining = (e) => {
        const total = Date.parse(e) - Date.parse(new Date());
        const seconds = Math.floor((total / 1000) % 60);
        const minutes = Math.floor((total / 1000 / 60) % 60);
        const hours = Math.floor((total / 1000 / 60 / 60) % 24);
        return {
            total, hours, minutes, seconds
        };
    }


    const startTimer = (e) => {
        let { total, hours, minutes, seconds }
            = getTimeRemaining(e);
        if (total >= 0) {

            setTimer(
                (hours > 9 ? hours : '0' + hours) + ':' +
                (minutes > 9 ? minutes : '0' + minutes) + ':'
                + (seconds > 9 ? seconds : '0' + seconds)
            )
        }
    }


    const clearTimer = (e) => {

        setTimer("00:25:00");

        if (Ref.current) clearInterval(Ref.current);
        const id = setInterval(() => {
            startTimer(e);
        }, 1000)
        Ref.current = id;
    }

    const getDeadTime = () => {
        let deadline = new Date();
        deadline.setSeconds(deadline.getSeconds() + 1500);
        return deadline;
    }

    //----------------time runner----------------------------ends


    //----------------testimonial slides--------------start
    const objectArr = [
        { image: "/assets/images/slide1.svg" },
        { image: "/assets/images/slide1.svg" },
        { image: "/assets/images/slide1.svg" }

    ];
    const [count, setCount] = useState(true);
    let [currentSlide, setCurrentSlide] = useState(0);
    const [isVisible, setIsVisible] = useState(false);
    const [offerModal, setOfferModal] = useState("modelinfo-wrap");
    const [discountModal, setDiscountModal] = useState("dscntmodelinfo-wrap");
    const [sectionType, setSectionType] = useState('default'); // discountedPlan ,default
    const [genderContent, setGenderContent] = useState("Men");
    const [weightContent, setWeightContent] = useState("");
    const [weightContentType, setWeightContentType] = useState("");


    const nextSlide = () => {
        if (count == true) {
            setCurrentSlide(++currentSlide);
            if (currentSlide == 2) {
                setCount(false)
            }
        } else {
            setCurrentSlide(--currentSlide);
            if (currentSlide == 0) {
                setCount(true);
            }
        }

    };


    const prevSlide = () => {
        if (count == true) {
            setCurrentSlide(++currentSlide);
            // console.log(currentSlide);
            if (currentSlide == 2) {
                setCount(false)
            }
        } else {
            setCurrentSlide(--currentSlide);
            // console.log(currentSlide);
            if (currentSlide == 0) {
                setCount(true);
            }
        }
    };


    useEffect(() => {
        const interval = setInterval(() => {
            nextSlide();
        }, 8000);

        return () => {
            clearInterval(interval);
        };
    }, [currentSlide]);


    //----------testimonial---slide-----ends-------------------

    useEffect(() => {

        if (window.location.pathname.split('/')[1] === "men") {
            setUrlPre("/men");
        }
        else if (window.location.pathname.split('/')[1] === "women") {
            setUrlPre("/women");
        }
        else if (window.location.pathname.split('/')[1] === "over40") {
            setUrlPre("/over40");
        }
        else {
            setUrlPre("");
        }


        clearTimer(getDeadTime());

        setTimeout(() => {
            setIsLoading(true); // Set loading state to false
        }, 250);

        if (localStorage.getItem('state')) {
            let base64_data = JSON.parse(atob(localStorage.getItem('state').slice(6, -4)));
            if (result.state === null) {
                history(urlPre + '/final.php', { state: base64_data });
            }
        }

        //----------------- gender filtration------------------------
        if (ReactSession.get('ketobalanced_options')) {
            const genderList = JSON.parse(ReactSession.get('ketobalanced_options')).survey.surveyItems[0].categoryItems;
            const genderName = genderList.filter(genderItem => genderItem.itemId == ReactSession.get('gender'));
            setGenderContent(genderName[0].name);
            // console.log(genderList);
        }

        //-------------- gender filtration-----------------------------

        //----------------- weight filtration------------------------
        setWeightContent(ReactSession.get('target'));
        setWeightContentType(ReactSession.get('ttype'));

        // console.log(setWeightContent);
        //-------------- weight filtration-----------------------------



        const toggleVisibility = () => {
            if (window.pageYOffset > 700) {
                setIsVisible(true);
            } else {
                setIsVisible(false);
            }
        };

        window.addEventListener('scroll', toggleVisibility);

        // Clean-up the event listener on unmount
        return () => window.removeEventListener('scroll', toggleVisibility);



    }, []);

    const scrollToTop = () => {
        window.scrollTo({
            top: 0,
            behavior: 'smooth'
        });
    };

    /* customer timer */

    const [data, setData] = useState([]);
    const [Dplandata, setDplanData] = useState([]);
    const [paymentList, setPaymentList] = useState({ paypal: false, payglocal: false, stripe: false });
    const [currency, setCurrency] = useState("usd");
    const [dataAll, setDataAll] = useState([]);
    const [allPointsList, setallPointsList] = useState([]);
    const [KetoBenefitsList, set_KetoBenefitsList] = useState([]);
    const [feedBackList, set_feedBackList] = useState([]);
    const [all_points_title, set_all_points_title] = useState(false);
    const [caseStudy, set_caseStudy] = useState("");
    const [successImage, set_successImage] = useState("");
    const [successTitle, set_successTitle] = useState("");
    const [successStories, set_successStory] = useState("");
    const [KetoBenefitsTitle, set_KetoBenefitsTitle] = useState("");
    const [clientid, setClientId] = useState("");
    const [feedBackTitle, set_feedBackTitle] = useState(null);
    const [discounted_pcr_before, set_discounted_pcr_before] = useState(null);
    const [discounted_pcr, set_discounted_pcr] = useState(null);


    const [notifyMessage, set_notifyMessage] = useState(null);


    const [isOpen, setIsOpen] = React.useState();
    const [isOpenOffer, setIsOpenOffer] = React.useState();
    const [billedText, setbilledText] = React.useState();
    const [billedPrice, setbilledPrice] = React.useState();
    const [billedCredits, setbilledCredits] = React.useState();
    const [billedDiscount, setbilledDiscount] = React.useState(0);
    const [planIndexId, setPlanIndexId] = React.useState(1);
    const [PlanId, setPlanId] = React.useState(1);




    const GetData = () => {


        try {


            if (result.state.responce && result.state.responce.plan) {
                setClientId(result.state.responce.CLIENT_ID);
                setBearer(result.state.responce.accessToken)
                result.state.responce.plan.forEach((planRow, index) => {
                    if (planRow.isTrue === true && index === planIndexId) {
                        setbilledText(planRow.name);
                        setbilledPrice(planRow.price);
                        setbilledDiscount((planRow.price - planRow.credits) * 100 / (planRow.price));
                        setbilledCredits(planRow.credits);
                        setPlanId(planRow.id);
                    } else {
                        planRow.isTrue = false;
                    }
                });

                //Dplan false

                result.state.responce.discountedplan.forEach((DplanRow, index) => {
                    if (DplanRow.isTrue === true && index === planIndexId) {
                        set_discounted_pcr_before(DplanRow.discounted_pcr_before);
                        set_discounted_pcr(DplanRow.discounted_pcr);
                    } else {
                        DplanRow.isTrue = false;
                    }
                });


            }
            else {
                setbilledPrice(0);
                setbilledDiscount(0);
                setbilledCredits(0);
            }

            if (result.state.responce) {
                set_notifyMessage(result.state.responce.caseStudy.message);
                setData(result.state.responce.plan);
                setDplanData(result.state.responce.discountedplan);
                setPaymentList(result.state.responce.paymentList);
                setDataAll(result.state);
                setallPointsList(result.state.responce.caseStudy.allPoints.list);
                var topTitle1 = result.state.responce.caseStudy.topTitle1;
                $('#topTitle1').html(topTitle1);
                set_all_points_title(result.state.responce.caseStudy.allPoints.title);
                set_feedBackTitle(result.state.responce.caseStudy["feedBack"].title);
                set_caseStudy(result.state.responce.caseStudy);
                set_KetoBenefitsList(result.state.responce.caseStudy.KetoBenefits.list);
                set_feedBackList(result.state.responce.caseStudy["feedBack"].list);
                set_successImage(result.state.responce.caseStudy.successStories.image);
                set_successTitle(result.state.responce.caseStudy.successStories.title);
                set_successStory(result.state.responce.caseStudy.successStories.stories);
                set_KetoBenefitsTitle(result.state.responce.caseStudy.KetoBenefits.title);

            }



        }
        catch (err) {
            // alert("Please process all steps correctly...");
            // history('/');  static temp on 16-Nov-2023
        }

    }

    const PayGlocalHandle = async (event) => {
        setIsPgProcessing(true);

        // var getway_api = "";
        if (event == "stickypaypal") {
            var getway_api = API_BASE_URL + '/pro/payment/stk/log/paypaloptioninitiate';
        } else {
            var getway_api = API_BASE_URL + '/pro/p3/pg/initiate';
        }

        let planid = PlanId;
        const postOption = {
            method: "POST",
            headers: { 'Content-Type': 'application/json', 'Authorization': 'Bearer ' + Bearer },
            body: JSON.stringify({
                'planId': planid,
                'callback': baseUrl + '/callback/pg'
            })
        }
        fetch(getway_api, postOption)
            .then(res => res.json())
            .then((result) => {
                if (result.status === 200) {
                    window.location.href = result.redirectUrl;
                    // setIsPgProcessing(false);
                } else if (result.error) {
                    alert(result.error.message);
                    setIsPgProcessing(false);
                }
            })
            .catch((err) => {
                // console.log(err);
                setIsPgProcessing(false);
            })

    }


    useEffect(() => {
        GetData();
        setTimeout(() => {
            history(urlPre + '/email.html');
        }, 1000 * 60 * 25);


    }, [])


    // ================== Bootstrap Modal======================

    const showModal = element => {
        setPlanIndexId(element);

